INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 2, 325, 5, 1, 40011, 2, 0, 126001, "クリア");
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES ("お兄。\nきてくれて、うれしい", 24001, 2, 326, 6, 1, 40011, 2, 0, 126101, "プレシア");
